typedef struct
{
    int x, y;        // 盒子左上角坐标
    int dx, dy;      // 水平和垂直移动方向
    short int color; // 盒子颜色
} Box;

#define NUM_BOXES 5
#define BOX_SIZE 10 // 盒子尺寸: 10x10
